import React from 'react';

class Ticker extends React.Component{
    constructor(props){
        super(props)
        this.state ={date: Date()}
    }


    render(){
        return(
            <div>
            {props.date.toLocalTimeString()}
            </div>
        )
    }
}

module.exports = Ticker;
